import react from 'react';

const SingleSelect = props => {
  return (
    <select onChange={(e) => props.onChange(props.filter, e.target.value)}>
      {props.options.map((option) => (
        <option value={option}>{option}</option>
      ))}
    </select>
  )
}

export default SingleSelect
